// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {LibDiamond} from "../libraries/LibDiamond.sol";

interface IProposalFacet {
    function propose(
        string memory _ipfsHash,
        LibDiamond.ProposalType _proposalType,
        uint256 _startTimestamp,
        uint256 _endTimestamp,
        uint256 _optionsCount,
        uint256 _minimumVotingPower,
        uint256 _voteLimit
    ) external;

    function getProposal(uint256 _proposalIndex)
        external
        view
        returns (LibDiamond.Proposal memory);

    function getAllProposal()
        external
        view
        returns (LibDiamond.Proposal[] memory);

    function getAllProposalOfType(LibDiamond.ProposalType _proposalType)
        external
        view
        returns (LibDiamond.Proposal[] memory);

    function getVotingPowers(uint256 _proposalIndex, uint256 _optionIndex)
        external
        view
        returns (uint256);

    function getVotingPowersOfAddress(
        uint256 _proposalIndex,
        uint256 _optionIndex,
        address _voter
    ) external view returns (uint256);

    function isProposalCompleted(uint256 _proposalIndex)
        external
        view
        returns (bool);

    function getDefaultMinimumVotingPowers() external view returns (uint256);

    function setDefaultMinimumVotingPowers(uint256 _votingPowers) external;
}
